import 'bootstrap/dist/css/bootstrap.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Signup from './Signup'

function App() {
  return (
   <BrowserRouter>
   <Routes>
    <Route path='/register' element={<Signup />}></Route>
    <Route path='/login' element={<Signup />}></Route>
   </Routes>
   </BrowserRouter>
  )
}

export default App;
